import "./CostList.css";

function CostList (props) {
   let costsContent = <p>В этом году расходов нет</p>;

   if (filteredCost.length > 0) {
     costsContent = filteredCost.map((cost) => (
       <CostItem
         key={cost.id}
         date={cost.date}
         description={cost.description}
         amount={cost.amount}
       />
     ));
   }
}

export default CostList
